import React from "react";
let uuid = "";
const url = 'https://valorant-api.com/v1/';
let search ="agents";
let happened = false;

function Agents() {
    fullData();
    return <div id="Agents">
        <img src={"https://media.valorant-api.com/playercards/9fb348bc-41a0-91ad-8a3e-818035c4e561/largeart.png"}  id="b"/>
        <select id="select">
        </select>
        <button id="button" onClick={change}>Change</button>

        <div id="role">
            <h2>Duelist</h2>
            <img src={"https://media.valorant-api.com/agents/roles/dbe8757e-9e92-4ed4-b39f-9dfc589691d4/displayicon.png"}/>
            <h3>Duelists are self-sufficient fraggers who their team expects, through abilities and skills, to get high frags and seek out engagements first.</h3>
        </div>
        <div id="abb1">
            <h2>Updraft</h2>
            <img src={"https://media.valorant-api.com/agents/roles/dbe8757e-9e92-4ed4-b39f-9dfc589691d4/displayicon.png"}/>
            <h3>Duelists are self-sufficient fraggers who their team expects, through abilities and skills, to get high frags and seek out engagements first.</h3>
        </div>
        <div id="role">
            <h2>Tailwind</h2>
            <img src={"https://media.valorant-api.com/agents/roles/dbe8757e-9e92-4ed4-b39f-9dfc589691d4/displayicon.png"}/>
            <h3>Duelists are self-sufficient fraggers who their team expects, through abilities and skills, to get high frags and seek out engagements first.</h3>
        </div>
        <div id="role">
            <h2>Duelist</h2>
            <img src={"https://media.valorant-api.com/agents/roles/dbe8757e-9e92-4ed4-b39f-9dfc589691d4/displayicon.png"}/>
            <h3>Duelists are self-sufficient fraggers who their team expects, through abilities and skills, to get high frags and seek out engagements first.</h3>
        </div>
    </div>
}

async function fullData() {
    const response = await fetch(url + search + "?isPlayableCharacter=true");
    const data = await response.json();
    if (!happened){
        let df = document.createDocumentFragment();
        for (let i = 0; i < data.data.length; i++){
            let option = document.createElement("option");
            option.value = data.data[i].uuid;
            option.appendChild(document.createTextNode(data.data[i].displayName));
            df.appendChild(option);
        }
        document.getElementById("select").appendChild(df);
        happened = true;
    }

    else {
        happened = false;
    }

    change();

}

async function find() {
        const response = await fetch(url +search + "/"+ uuid);
        const data = await response.json();
        document.getElementById('b').src=data.data.displayIcon;

}

function change(){
    uuid = (document.getElementById("select").value);
    find();
}

export default Agents;
